import Link from 'next/link';
const Index = () => (
	<div>
		<ul>
			<li><Link href="/login"><a>Login</a></Link></li>
			<li><Link href="/signup"><a>Signup</a></Link></li>
		</ul>
		<div className="title">
			<h4>Welcome to</h4>
		</div>
		<style jsx>{`
			ul {
				background: #333;
				display: flex;
				list-style: none;
				margin: 0px;
				padding: 10px;
			}
			ul li {
				font-size: 18px;
				margin-right: 10px;
			}
			ul li a {
				color: white;
				text-decoration: none;
			}
			.title h4{
				text-align: center;
				font-weight: normal;
			}
		`}
		</style>
	</div>
)

export default Index;
